import { BgImg, StyledFeatured } from './styles/Featured.styed';

const Featured = () => {
  return (
    <StyledFeatured>
      <BgImg
        src="https://images.pexels.com/photos/2726370/pexels-photo-2726370.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260"
        alt=""
      />

      <div></div>
    </StyledFeatured>
  );
};

export default Featured;
